def rot(n,r):
    y = (n / 3)
    x = n%3 
    if r == 2:
        y,x = x, 2-y
    if r == 3:
        y,x = 2-x, 2-y
    if r == 4:
        y,x = 2-x, y
    if r == 5:
        y,x = y, x
    if r == 5:
        y,x = y, 2-x
    if r == 6:
        y,x = 2-y, 2-x
    if r == 7:
        y,x = 2-y, x
    return 3*y+x

